import React from 'react';
import { Route, Navigate } from 'react-router-dom';
import { useAuth } from './AuthContext';

const PrivateRoute = ({ element, ...rest }) => {
    const { auth } = useAuth();

    return (
        <Route
            {...rest}
            element={auth.token ? element : <Navigate to="/Login" />}
        />
    );
};

export default PrivateRoute;
